import { Fragment } from "react";
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'
import "./App.css";

function App() {
  return <>
  <Fragment>
    <Router>
      <Routes>
        <Route path="/"></Route>
      </Routes>
    </Router>
  </Fragment>
  </>;
}

export default App;
